    [],nt"revision_timestamp": "2016-07-27T22:55:32.817970",nt"name": "a-harvest-management-strategy-for-canada-geese-in-the-western-mississippi-flyway",nt"isopen":
    false,nt"url": null,nt"notes": "Management of Canada goose (Branta canadensis)
    harvest in the Mississippi Flyway became increasingly complex during the 1980s.
    A strategy for managing harvest was outlined in a management plan for the EPP (Mississippi
    Flyway Technical Section 1992:14-15); however, more specific strategies that include
    provisions for other Canada goose populations are needed. This document will serve
    as a more specific amendment to strategies in the EPP management plan and will apply
    to all Canada geese in the western Mississippi Flyway. In addition to EPP Canada
    geese, primary components considered will be giant Canada geese (both locally and
    in migration) and small Canada geese (assumed to be TGP). The objective is to provide
    the maximum hunting opportunity and sustained harvest of Canada geese that are consistent
    with the status of populations in the western Mississippi Flyway.",nt"license_title":
